Ofta är det människor som springer mycket, är överviktiga, äldre människor eller gravida kvinnor som upplever obehag och smärta i framfoten. Upp till 80% av Sveriges befolkning lider periodvis eller konstant av fotbågsfall/nedsunken framfot.

